import { Route } from "react-router-dom";
import { Fragment } from "react";
import Welcome from "./components/Welcome";
import Products from "./components/Products";

function App() {
  return (
    <div>
      <Fragment>
        <Route path="/welcome">
          <Welcome></Welcome>
        </Route>
        <Route path="/products">
          <Products></Products>
        </Route>
        <h3>Home Page!</h3>
      </Fragment>
    </div>
  );
}

export default App;
